import React from 'react';
import './Navbar.css'

const Navbar = () => {
    return (
        <div> 
            <nav className=''>
            <ul> 
              <li><a href="./projects">projects</a></li>
              <li><a href="./about">about</a></li>
              <li><a href="./contact">contact</a></li>
            </ul>
            </nav>

        </div>
    );
};

export default Navbar;
